*{
    box-sizing: border-box;
    padding: 0px;
    margin: 0px;
}
html, body{
    height:100%;
    margin:0;
    font-family: 'Roboto Mono', monospace;
    background-color: rgb(227, 226, 226);
}

.my-container{
    display: flex;
    flex-wrap: wrap;
}
.centerHorizontal{
    justify-content:center ;
}
.rigthHorizontal{
    justify-content:flex-end
}
.centerVertical{
    align-items: center;
}
.centerHorizontalVertical {
    align-items: center;
    justify-content:center;
}
.nav {
    /*background: linear-gradient(to left, #0073cf 0%, #ffffff 100%);*/
    padding: 20px;
    list-style-type:none;
    background-color: white;
}
.li-inline-block{
    flex-grow: 1;
    text-align: end;
}
.nav .li-inline-block li{
    display: inline-block;
    font-size: 19px;
    margin: 0px 20px;
}
.nav .li-inline-block li:hover{
    font-size: 20px;
}
.hamburger {
    min-height: 30px;
    max-width: 50px;
}
.hamburger-inner, .hamburger-inner:after, .hamburger-inner:before {
    background-color: black;
    position: absolute;
    width: 40px;
    height: 4px;
    border-radius: 5px;
    content: '';
    transition-timing-function: ease;
    transition-duration: .2s;
}
.hamburger-inner:before {
    top: 10px;
    transition-property: transform,opacity;
}
.hamburger-inner:after {
    top: 20px;
}
.ul-app-view{
    text-align: center;
    font-size: 25px;
}
.x-inner{
    position: absolute;
    width: 40px;
    height: 4px;
    border-radius: 5px;
    content: '';
    transition-timing-function: ease;
    transition-duration: .2s;
}
 .x-inner:after, .x-inner:before {
    background-color: black;
    position: absolute;
    width: 40px;
    height: 4px;
    border-radius: 5px;
    content: '';
    transition-timing-function: ease;
    transition-duration: .2s;
}
.x-inner:before {
    transform: rotate(45deg)
}
.x-inner:after {
    transform: rotate(-45deg)
}
